# 881.救生艇
#第 i 个人的体重为 people[i]，每艘船可以承载的最大重量为 limit。
#
#每艘船最多可同时载两人，但条件是这些人的重量之和最多为 limit。
#
#返回载到每一个人所需的最小船数。(保证每个人都能被船载)。
#
# 
#
#示例 1：
#
#输入：people = [1,2], limit = 3
#输出：1
#解释：1 艘船载 (1, 2)
#示例 2：
#
#输入：people = [3,2,2,1], limit = 3
#输出：3
#解释：3 艘船分别载 (1, 2), (2) 和 (3)
#示例 3：
#
#输入：people = [3,5,3,4], limit = 5
#输出：4
#解释：4 艘船分别载 (3), (3), (4), (5)
#提示：
#
#1 <= people.length <= 50000
#1 <= people[i] <= limit <= 30000
#


# 错误解法：不应该从最重的人去考虑，应该从最轻的人去考虑
# class Solution:
# 	def numRescueBoats(self, people: list, limit: int) -> int:
# 		people.sort()
# 		ans = 0
# 		while people:
# 			people = self._rescueBoats(people, limit)
# 			ans += 1
# 		return ans
#
# 	def _rescueBoats(self, people, limit):
# 		if len(people) == 1:
# 			people.pop()
# 			return people
# 		else:
# 			heavy = people.pop()
# 			for i in range(len(people) - 1, -1, -1):
# 				flag = i
# 				if people[i] + heavy == limit:
# 					light = people.pop(i)
# 					return people
# 				elif people[i] + heavy > limit:
# 					continue
# 				elif people[i] + heavy < limit:
# 					people.pop(flag)
# 					return people
# 			return people


class Solution(object):
    def numRescueBoats(self, people, limit):
        people.sort()
        i, j = 0, len(people) - 1
        ans = 0
        while i <= j:
            ans += 1
            if people[i] + people[j] <= limit:
                i += 1
            j -= 1
        return ans


